import { useState, useEffect } from "react";
interface Item {
  id: number;
  name: string;
  price: string;
  payed: boolean;
}

type ItemProps = Omit<Item, "id">;

const Item = ({ name, price, payed }: ItemProps) => (
  <li>
    <span>{name}</span>
    <span>{price}</span>
  </li>
);

export const Cart = () => {
  const [items, setItems] = useState<Item[]>([]);

  useEffect(() => {
    setItems([
      { id: 1, name: "Espresso", price: "5.00€", payed: true },
      { id: 2, name: "Espresso", price: "5.00€", payed: false },
      { id: 3, name: "Orange Juice", price: "7.50€", payed: false },
      { id: 4, name: "Club Sandwich", price: "12.00€", payed: false },
      { id: 5, name: "Club Soda", price: "2.75€", payed: false },
    ]);
  }, []);

  return (
    <ul>
      {items.map((item) => (
        <Item key={item.id} name={item.name} price={item.price} />
      ))}
    </ul>
  );
};
